class Solution {
  bool canSplitArray(List<int> nums, int m) {
    // Function to check if the current partition is valid.
    bool isValidPartition(int start, int end, int m, List<int> nums) {
      int sum = 0;
      for (int i = start; i <= end; i++) {
        sum += nums[i];
      }
      return sum >= m || end - start == 0;
    }

    // DFS function to try all possible splits.
    bool dfs(int index, int m, List<int> nums, int splits, int n) {
      if (index == n) {
        // If we've reached the end, check if we've made enough splits.
        return splits == n - 1;
      }
      int sum = 0;
      for (int i = index; i < n; i++) {
        sum += nums[i];
        // If the sum from the current index to i meets the requirement,
        // or we're considering a single element, explore further.
        if (sum >= m || i == index) {
          if (dfs(i + 1, m, nums, splits + 1, n)) {
            return true;
          }
        }
      }
      return false;
    }

    return dfs(0, m, nums, 0, nums.length);
  }
}
